local getArgs = require('Module:Arguments').getArgs
local p = {}

function p.main(frame)
	local args = getArgs(frame)
	return p._main(args)
end

function p._main(args)
	local s = ''
	local frame = mw.getCurrentFrame()

	for c in (args[1] or ''):gmatch'.' do
		s = s .. frame:expandTemplate{ title = 'mjs', args = { c .. 'm' } }
	end

	for c in (args[2] or ''):gmatch'.' do
		s = s .. frame:expandTemplate{ title = 'mjs', args = { c .. 'p' } }
	end

	for c in (args[3] or ''):gmatch'.' do
		s = s .. frame:expandTemplate{ title = 'mjs', args = { c .. 's' } }
	end

	for c in (args[4] or ''):gmatch'.' do
		s = s .. frame:expandTemplate{ title = 'mjs', args = { c .. 'z' } }
	end

	for c in (args[5] or ''):gmatch'.' do
		s = s .. frame:expandTemplate{ title = 'mjs', args = { 'z' } }
	end

	return s
end

return p
